// import Header from './components/Header';
import Home from './components/Home';
import About from './components/About';
import {Link} from 'react-router-dom';

import 'bootstrap/dist/css/bootstrap.min.css';

import './App.css';

function App() {
  return (
    <Router>
    <div className="App">
      {/* {<Home/>} */}
      {/* {<About />} */}
      {/* {<Portfolio />} */}
      {/* {<Resume />} */}
    <Link to="/about">
      About
    </Link>
    <Link to="/portfolio">
      Portfolio
    </Link>
    <Link to="/resume">
      Resume
    </Link>
    <Link to="/contact">
      Contact
    </Link>
    </div>
    </Router>
  );
}

export default App;
